function I = fcnK0S(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ u;t2 = 0.1e1 ./ T;t3 = t2 .* t1;t4 = sqrt(-u);t5 = 0.1e1 ./ t4;t6 = t5 .* t3;t7 = T .^ 2;t10 = 0.1e1 ./ (-t7 + 0.4e1 .* u);t11 = F - t4;t12 = t11 .^ 2;t13 = 0.2e1 .* t4;t15 = t11 .* (T + t13);t16 = t4 .* T;t18 = sqrt(t12 + t15 + t16);t19 = 0.1e1 ./ t18;t20 = t19 .* t10;t21 = F .* t20;t24 = F + t4;t25 = t24 .^ 2;t27 = t24 .* (T - t13);t29 = sqrt(t25 + t27 - t16);t30 = 0.1e1 ./ t29;t31 = t30 .* t10;t32 = F .* t31;t35 = u .^ 2;t36 = 0.1e1 ./ t35;t37 = t2 .* t36;t40 = t5 .* t1;t42 = T .* t36;t45 = t10 .* t36;t49 = sqrt(t16);t50 = 0.1e1 ./ t49;t51 = 0.2e1 .* t16;t55 = 0.1e1 ./ t11;t57 = log(t55 .* (0.2e1 .* t18 .* t49 + t15 + t51));t62 = 0.1e1 ./ t7 .* t1;t71 = -0.2e1 .* t21 .* t6 + 0.2e1 .* t32 .* t6 - 0.5e1 ./ 0.8e1 .* t19 .* t37 - t20 .* t40 + 0.5e1 ./ 0.8e1 .* t20 .* t42 + 0.5e1 ./ 0.4e1 .* F .* t19 .* t45 + 0.5e1 ./ 0.8e1 .* t57 .* t50 .* t37 + 0.3e1 ./ 0.4e1 .* t19 .* t5 .* t62 - 0.3e1 ./ 0.2e1 .* t20 .* t3 + t31 .* t40 + 0.5e1 ./ 0.8e1 .* t31 .* t42;t75 = sqrt(-t16);t76 = 0.1e1 ./ t75;t80 = 0.1e1 ./ t24;t82 = log(t80 .* (0.2e1 .* t29 .* t75 + t27 - t51));t113 = 0.5e1 ./ 0.4e1 .* F .* t30 .* t45 + 0.5e1 ./ 0.8e1 .* t82 .* t76 .* t37 - 0.3e1 ./ 0.4e1 .* t30 .* t5 .* t62 - 0.3e1 ./ 0.2e1 .* t31 .* t3 - 0.5e1 ./ 0.8e1 .* t30 .* t37 - t30 .* t80 .* t5 .* t3 ./ 0.4e1 - 0.3e1 .* t32 .* t62 + 0.3e1 ./ 0.4e1 .* t82 .* t76 .* t5 .* t62 + t19 .* t55 .* t5 .* t3 ./ 0.4e1 - 0.3e1 .* t21 .* t62 - 0.3e1 ./ 0.4e1 .* t57 .* t50 .* t5 .* t62;t114 = t71 + t113;
